window.bookSummaryJSON = "<p>The scar across the side of Jack’s head is the visible price. The risk to his friends at the academy is the hidden price. His challenge is how to balance the risks.</p> <p>The final stage of his training is a shakedown cruise on an old minesweeper, barely able to achieve FTL entry and exit.&nbsp;</p> <p>Midway through their cruise, the minesweeper collides with an ancient alien wreck, ripping the sides off the starship. Jack’s team of bots help seal the combined wreck to prevent air loss. Ghost, a nanolife form from the alien wreck, provides assistance.&nbsp;</p> <p>Jack and his girlfriend, Sofia, are the only survivors, and air, food, and supplies are critical.&nbsp;</p> <p>The countdown of days to survive is ticking.&nbsp;</p> <p>No wonder the Royal Family are angry.&nbsp;</p> <p>And there’s still a price on Jack’s head.</p>"; 
